        private ILogger<CurrentContentController> Logger { get; set; }
        public CurrentContentController(GameManager gameManager, ILogger<CurrentContentController> logger)
        {
            this.GameManager = gameManager;
            this.Logger = logger;
        }

        private GameManager GameManager { get; set; }

        [HttpGet]
        public IActionResult Get(string id, string promptId, bool db)
        {
            if (!ModelState.IsValid)
            {
                return new BadRequestResult();
            }

            const bool tempDebug = false;
            if (tempDebug)
            {
                return DebugResponse();
            }

            if (!Sanitize.SanitizeString(id, out string error, Common.DataModels.Constants.RegexStrings.UserId, 50, 50))
            {
                return BadRequest(error);
            }

            User user = GameManager.MapIdentifierToUser(id, out bool newUser);
            if (user != null)
            {
                user.LastPingTime = DateTime.UtcNow;

                // Only update activity time if the dirty bit is set / they touched their device.
                if (db)
                {
                    user.LastActivityTime = DateTime.UtcNow;
                }
            }

            try
            {
                if (user?.UserState == null)
                {
                    /*Debug.Assert(false, "User not in a state!");
                    Logger.LogWarning(message: $"User (name:'{user?.DisplayName}', id:'{id}') is not in a state");
                    return BadRequest("Error finding/creating user object.");*/

                    // TODO: test / figure out use case here.
                    return new JsonResult(null);
                }

                lock (user.LockObject)
                {
                    var prompt = user.UserState.UserRequestingCurrentPrompt(user);

                    var currentContent = new CurrentContent
                    {
                        PromptId = prompt.Id,
                        UserPrompt = (promptId == prompt.Id.ToString()) ? null : prompt,
                        RefreshTimeInMs = prompt.RefreshTimeInMs,
                        UserListMetadata = GetUserListMetadata(prompt,user)
                    };
                    return new JsonResult(currentContent);
                }
            }
            catch (Exception e)
            {
                // If this is reached, the game state is likely corrupted and the lobby will need to be restarted or the user evicted.
                GameManager.ReportGameError(ErrorType.GetContent, user?.LobbyId, user, e);
                return new BadRequestResult();
            }
        }

        private UserListMetadata GetUserListMetadata (UserPrompt prompt, User user) 
        {
            if (prompt.DisplayUsers == null) return null;

            IReadOnlyList<User> relevantUsers = new List<User>();
            switch (prompt.DisplayUsers)
            {
                case UserListMetadataMode.AllUsers: relevantUsers = user.Lobby.GetAllUsers(); break;
                case UserListMetadataMode.WaitingForPlayers: relevantUsers = user.Lobby.GetAllUsers().Where(user => user.Status == UserStatus.AnsweringPrompts).ToList(); break;
                default: throw new Exception("Unknown value for DisplayUsers");
            }
            return new UserListMetadata
            {
                UserCount = relevantUsers.Count,
                UserRecords = relevantUsers.Take(10).Select(user =>
                      new UserRecordType
                      {
                          PlayerName = user.DisplayName
                      }).ToArray()
            };

        }
